	saveData() {
		// \{\s+(\S+:\s*\S+,)\s+(\S+:\s*\S+)\s+\} => { $1 $2 }
		const data = Object.entries(this).reduce((s, [k, v]) => s + "\n\t" + (typeof v === "function" ? v.toString() : k.replace(/^\S+\s+.+$/, '"$&"') + ": " + JSON.stringify(v)) + ",", "const " + this.name + " = {") + "\n}";
		const file = new Blob([data], {type: "text/javascript"});
		const a = document.createElement("a"),
		url = URL.createObjectURL(file);
		a.href = url;
		a.download = this.name + ".js";
		document.body.appendChild(a);
		a.click();
		setTimeout(function() {
			document.body.removeChild(a);
			window.URL.revokeObjectURL(url);
		}, 0);
	},
	fillAll() {
		switch (window.location.hostname) {
			case "inara.cz": this.fillEngineers().then(d => d.fillMaterials()).then(d => d.fillModifications()).then(d => d.saveData()); break;
			case "galnet.fr": this.fillMatTrads().then(d => d.saveData()); break;
			default: this.fillMatTrads().then(d => d.fillEngineers()).then(d => d.fillMaterials()).then(d => d.fillModifications()).then(d => d.saveData());
		}
	},
	getPageDocument(url) {
		return new Promise((resolve, reject) => {
			if (location.href.startsWith(url)) {
				resolve(document);
			} else {
				const getDocument = html => {
					const page = document.implementation.createHTMLDocument();
					page.documentElement.innerHTML = html;
					if (!url.startsWith(location.origin)) {
						page.documentElement.querySelector("head").insertAdjacentHTML("afterbegin", "<base href='" + url + "'/>");
					}
					resolve(page.documentElement);
				};

				const request = (typeof(GM_xmlhttpRequest) === "undefined")
					? () => fetch(url).then(r => r.text().then(getDocument)).catch(reject)
					: () => GM_xmlhttpRequest({ url: url, method: "GET", onload: r => getDocument(r.responseText), onerror: r => reject(r.responseText) });

				const wait = 500;
				window.setTimeout(request, wait);
			}
		});
	},
	async fillEngineers() {
		this.engineers = {};
		const engDoc = await this.getPageDocument("https://inara.cz/engineers/");
		const tree = { h: {}, o: {},
			compute(engineers, engineer, e, i) {
				const name = e.textContent;
				const inst = this[engineer.isOdyssey ? "o" : "h"];
				engineer.parents = inst[i];
				engineer.parents?.forEach(p => { engineers[p].children = [...(engineers[p].children ?? []), name]; });
				["arrowdown", "arrowright", "arrowplusdown", "arrowplusright"].filter(clazz => e.closest(".mainblock").classList.contains(clazz)).forEach(clazz => {
					const isBrother = clazz.match(/^arrowplus.+$/), isDown = clazz.match(/^.+?down$/);
					const curParents = inst[i + (isDown ? 5 : 1)];
					if (curParents) {
						curParents.push(...(isBrother ? engineer.parents ?? [] : [name]));
					} else {
						inst[i + (isDown ? 5 : 1)] = isBrother ? engineer.parents : [name];
					}
				});
			}
		};
		engDoc.querySelectorAll("#engineerstype0 .infobottom > a span").forEach((e, ind) => {
			const cur = this.engineers[e.textContent] = { url: e.parentElement.href, modules: {}, isOdyssey: false, isSuperEngineer: this.superEngineers.includes(e.textContent) };
			tree.compute(this.engineers, cur, e, ind);
			for (let i = 0, p = e.closest(".mainblock").querySelectorAll(".engineeritemsinfo > span"); i < p.length; i += 2) {
				cur.modules[p[i+1].textContent] = Number(p[i].textContent.replace(/^G(\d+):/i, "$1"));
			}
		});
		engDoc.querySelectorAll("#engineerstype1 .infobottom > a span").forEach((e, ind) => {
			const cur = this.engineers[e.textContent] = { url: e.parentElement.href, modules: {}, isOdyssey: true };
			tree.compute(this.engineers, cur, e, ind);
			e.closest(".mainblock").querySelectorAll(".engineeritemsinfo > span").forEach(e => { cur.modules[e.textContent] = null; });
		});

		Object.values(this.engineers).filter(info => info.children).forEach(info => { info.children.sort((a, b) => {
			const eA = this.engineers[a], eB = this.engineers[b];
			let res = !eA.children ^ !eB.children ? (eA.children ? -1 : 1) : 0;
			res ||= eA.isSuperEngineer ^ eB.isSuperEngineer ? (eA.isSuperEngineer ? 1 : -1) : 0;
			return res || (a < b ? -1 : 1);
		}); });

		return this;
	},
	async fillMaterials() {
		this.materials = {};
		(await this.getPageDocument("https://inara.cz/components/")).querySelectorAll("#components tbody tr").forEach(tr => {
			const mat = {};
			tr.querySelectorAll("td").forEach((td, i) => {
				switch (i) {
					case 0:
						this.materials[td.querySelector("a").textContent.trim()] = mat;
						mat.url = td.querySelector("a").href;
						break;
					case 1:
						const grade = (td.lastChild.nodeType === 1 ? td.lastChild.lastChild : td.lastChild).data.trim();
						mat.grade = this.grades.rank[grade] ?? Number(grade);
						break;
					case 2:
						mat.type = td.firstChild.data.trim();
						mat.subType = td.querySelector("span")?.textContent.replace(/^\s*\(|\)\s*$/g, "");
						mat.isOdyssey = !mat.subType;
						break;
				}
			});
		});

		return this;
	},
	async fillModifications() {
		this.modifications = {};
		const effectName = (e) => e.closest(".blocktoggledummy").previousElementSibling.textContent.replace(/^(.+?)\s\(.+$/g, "$1");
		const effectUrl = (bp, e) => bp.url + "#" + e.closest(".blocktoggledummy").previousElementSibling.id?.replace(/cont$/, "");

		const fetchBpData = async (moduleName, module, bp) => {
			(await this.getPageDocument(bp.url)).querySelectorAll(".mainblock:not(.mainblocksmall)").forEach((cont, i) => {
				const isBlueprint = cont.querySelector(":scope .blocktoggledummytrigger")?.firstChild?.data.startsWith(moduleName);
				cont.querySelectorAll(".floatleft .insideblock2, .floatright .insideblock2").forEach((e, lvl) => {
					const obj = isBlueprint ? bp : (module.effects[effectName(e)] ?? (module.effects[effectName(e)] = { url: effectUrl(bp, e), materials: {} }));
					if (isBlueprint || Object.keys(obj.materials).length === 0) {
						[...e.querySelectorAll(".materialcount")].filter(count => count.hasChildNodes()).forEach(count => {
							const matName = count.nextElementSibling.nextElementSibling.querySelector(":scope > a").textContent;
							const mat = obj.materials[matName] ?? (obj.materials[matName] = []);
							mat.push({ level: isBlueprint ? lvl + 1 : 9, count: Number(count.textContent) });
						});
					}
				});
			});
		};

		const bpDoc = await this.getPageDocument("https://inara.cz/blueprints/");
		const engParseInfo = [
			{ cont: ".blueprints4cols .insideblock0", moduleName: ".blocktoggledummytrigger", bp: "a.nounderline", bpName: (bp) => bp.querySelector(".tag").textContent, url: (bp) => bp.href, isOdyssey: false },
			{ cont: ".blueprints2cols .insideblock0", moduleName: ".header", bp: ".tag", bpName: (bp) => bp.lastChild.textContent.trim(), url: (bp) => bp.lastChild.previousElementSibling.href, isOdyssey: true },
		];
		for (const parseInfo of engParseInfo) {
			for (const cont of bpDoc.querySelectorAll(parseInfo.cont)) {
				const moduleName = cont.querySelector(parseInfo.moduleName).textContent;
				const module = this.modifications[moduleName] = { blueprints: {}, effects: {}, isOdyssey: parseInfo.isOdyssey };
				for (const e of cont.querySelectorAll(parseInfo.bp)) {
					const bp = module.blueprints[parseInfo.bpName(e)] = { url: parseInfo.url(e), materials: {} };
					await fetchBpData(moduleName, module, bp);
				}
			}
		}

		return this;
	},
	async fillMatTrads() {
		this.matTrads = {};
		const tradDoc = await this.getPageDocument("https://galnet.fr/marchandises-materiaux-donnees-elite-dangerous/");
		const tradTables = {
			"fr-en": ["marchandises", "materiaux1", "materiaux2", "donnees", "tech", "circuits", "chimiques", "data-od"],
			"en-fr": ["marchandisesrares"]
		};
		Object.entries(tradTables).forEach(([langs, ids]) => {
			const [from, to] = langs.split("-");
			const invert = to === "en";
			ids.forEach(id => {
				[...tradDoc.querySelectorAll("#" + id + " + table tbody tr")].filter(tr => !tr.querySelector("strong")).forEach(tr => {
					this.matTrads[tr.querySelector(`td:${ invert ? "last" : "first" }-child`).textContent] = tr.querySelector(`td:${ invert ? "first" : "last" }-child`).textContent;
				});
			});
		});

		return this;
	},
